import { resolve } from "upath";
import { reject } from "rsvp";

// Actions check_tokens

export const SetTokensList = (token) => { 
    return {
      type: 'SET_TOKENS_LIST', 
      payload: new Promise ((resolve, reject) => {
        setTimeout (()=>{
          resolve(token)
        },2000);
      })
    }
  }


